    private ReaderFactory readerFactory;
    private boolean readSomething;

    @Before
    public void startUp()
    {
        this.readerFactory = new ReaderFactory();
        this.readSomething = false;
    }

    @Test
    public void testReaderFactoryWorksCorrectlyWithVideoReader() throws FactoryException {
        String bean = "videoReader";
        Reader reader = readerFactory.getReaderType(bean);
        assertEquals(reader.getClass().getName(), "is.ru.honn.rutube.reader.VideoReader");
    }

    @Test
    public void testReaderFactoryWorksCorrectlyWithUserReader() throws FactoryException {
        String bean = "userReader";
        Reader reader = readerFactory.getReaderType(bean);
        assertEquals(reader.getClass().getName(), "is.ru.honn.rutube.reader.UserReader");
    }

    @Test
    public void testReaderFactoryWithNonExistingBean()
    {
        try
        {
            String bean = "nonExistingBean";
            Reader reader = readerFactory.getReaderType(bean);
        }
        catch (FactoryException ex)
        {
            assertEquals("There was no bean found with that name", ex.getMessage());
        }
    }

    @Test
    public void testReaderSetUri() throws FactoryException {

        Reader reader = readerFactory.getReaderType("videoReader");

        try {
            reader.setURI("http://mockaroo.com/f13b8200/download?count=1&key=e79a3650");
        }
        catch (ReaderException e)
        {}

        assertTrue(reader.getIsURISet());

    }

    @Test
    public void testReaderSetUriWrong() throws FactoryException {

        Reader reader = readerFactory.getReaderType("videoReader");

        try {
            reader.setURI(null);
        }
        catch (ReaderException e)
        {
            assertEquals("Unable to set URI", e.getMessage());
        }

    }

    @Test
    public void testReaderSetReadHandler() throws FactoryException, ReaderException {
        try
        {
            Reader reader = readerFactory.getReaderType("videoReader");
            reader.setReadHandler(this);
            Object obj = "some obj";
            read(1, obj);

        }
        catch(FactoryException ex)
        {}

        assertTrue(readSomething);
    }

